import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";


function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<h1 style={{ textAlign: "center", marginTop: "50px" }}>Doctor Appointment Application</h1>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
